import React, { Component } from 'react';
import Keys from './components/keyboard';
import './App.css';
import Screen from './components/screen';

function App() {
  const photo = require('./components/download.png');

  return (
    <div>
      <div>
        <Screen img={photo}/>
        <img src={photo}></img>
      </div>
      <div>
        <Keys/>
      </div>
    </div>
  );
}

export default App;
